    number: '6'
    value: 'February 19, 2009    Federal Election Commission  Washington D.C.  20463  Attention:  Mr.
      Brian Bennett    Dear Mr. Bennett:    We are in receipt of your letter dated
      January 21, 2009 regarding our October monthly report (9/1/08-9/30/08) wherein
      our use of allocated funds for national convention expenditures were questioned
      (item 3).  These expenditures were for our office staff to be onsight to assist
      Utah delegates at the convention.  They were NOT expenditures associated with
      sending delegates to the convention as those costs were paid for by the delegates
      themselves.    Your letter also questioned the use of allocated  funds to purchase
      voter lists (item 4).  The lists purchased were relevant to state candidates
      only and NOT associated with any federal candidates.  It was paid for with allocated
      funds because it was part of another expenditure reimbursement and including
      it simplified reimbursement as well as reporting.    Sincerely  Mike McCauley,
      CPA  Utah Republican Party Treasurer'
